  /** \u6807\u9898 */
  title?: string
  /** \u9009\u62E9\u9879\u5217\u8868 */
  list: Item[]
  /** \u662F\u5426\u663E\u793A\u786E\u8BA4\u6309\u94AE\uFF0C\u591A\u9009\u65F6multiSelect\u5F3A\u5236\u4E3Atrue */
  needConfirm?: boolean
  /** \u662F\u5426\u591A\u9009 */
  multiSelect?: boolean
  /** \u521D\u59CB\u9009\u4E2D\u7684 */
  defaultSelected?: Item[]
  /** \u641C\u7D22\u529F\u80FD */
